sql_queries_ready.coredata_allocate_pk_transaction_pattern:
-- PSEUDO SQL PATTERN (run inside a transaction from app code)
BEGIN IMMEDIATE TRANSACTION;

-- 1) Read current max for entity
SELECT Z_MAX FROM Z_PRIMARYKEY WHERE Z_ENT = :entityId;

-- 2) nextPk = Z_MAX + 1 (or 1 if NULL / row missing, but row should exist)
-- 3) Update allocator
UPDATE Z_PRIMARYKEY
   SET Z_MAX = :nextPk
 WHERE Z_ENT = :entityId;

-- 4) Insert row using Z_PK = :nextPk, Z_ENT = :entityId, Z_OPT = 1
--    (plus business fields)

COMMIT;

